        <div>
            <img id="loading."
          src=""
          alt="Loading"
        />
            <h1>Bienvenidos a Mattger GAMES</h1>
            <Link to = '/home'>
                <button>Ingresar</button>
            </Link>
        </div>
    )
}

const Container = styled.div `
background-image: landing.webp
`
